import React from "react";
import "./App.css";
import Pomodoro from "./pomodoro/Pomodoro";
import Header from "./Header";

function App() {
  return (
    <div className="App">
      <header className="App-header container">
        <Header /><h1>Pomodoro Timer</h1>
      </header>
      <div className="container">
        <Pomodoro />
      </div>
    </div>
  );
}

export default App;
